properties.cmdline:
VarG_c_logFileName="${p:InitStep/Depot}/${p:InitStep/Nom_Projet}/log/${p:InitStep/Nom_Log}"


Var_Cmd_Out=$(${p:InitStep/Script};jndProjectMgr.sh --project ${p:InitStep/Nom_Projet}  --all-instances sync-applis 2>&1)
status=$?
echo "$Var_Cmd_Out" | tee -a ${VarG_c_logFileName}

if [ $status -eq 0 ]; then
	echo "`date +%Y%m%d-%H%M%S`: [INFO] synchronisation des applications terminee"  2>&1 | tee -a ${VarG_c_logFileName} 
else
	echo "`date +%Y%m%d-%H%M%S`: [ERROR]  Impossible de synchroniser les applications"  2>&1 | tee -a ${VarG_c_logFileName}
	exit 1
fi

echo "`date +%Y%m%d-%H%M%S`: [INFO]  suppression du package"  2>&1 | tee -a ${VarG_c_logFileName}
rm -f ${p:InitStep/Depot}/${p:InitStep/Nom_Projet}/${p:InitStep/Nom_Package}
status=$?
if [ $status -ne 0 ]; then
	echo "`date +%Y%m%d-%H%M%S`: [WARN] impossible de supprimer ${p:InitStep/Depot}/${p:InitStep/Nom_Projet}/${p:InitStep/Nom_Package}"  2>&1 | tee -a ${VarG_c_logFileName} 
fi


exit 0

